<!DOCTYPE HTML>
<html>
	<head>
		<title>Rick Astley</title>
		<meta charset="utf-8" />
		<meta name="viewport" content="width=device-width, initial-scale=1" />
		<style>
			a,article,big,body,div,footer,h1,h2,h3,h4,h5,h6,header,html,img,li,nav,p,s,span,strong,u,ul{
				margin:0;
				padding:0;
				border:0;
				font-size:100%;
				font:inherit;
				vertical-align:baseline
			}
			article,footer,header,nav{
				display:block
			}
			body{
				line-height:1
			}
			ul{
				list-style:none
			}
			body{
				-webkit-text-size-adjust:none
			}
			*,:after,:before{
				-moz-box-sizing:border-box;
				-webkit-box-sizing:border-box;
				box-sizing:border-box
			}
			.container.\31 25\25{
				width:100%;
				max-width:125%;
				min-width:100%
			}
			.container.\37 5\25{
				width:75%
			}
			.container.\35 0\25{
				width:50%
			}
			.container.\32 5\25{
				width:25%
			}
			.container{
				width:100%!important
			}
			.row{
				border-bottom:solid 1px transparent;
				-moz-box-sizing:border-box;
				-webkit-box-sizing:border-box;
				box-sizing:border-box
			}
			.row>*{
				float:left;
				-moz-box-sizing:border-box;
				-webkit-box-sizing:border-box;
				box-sizing:border-box
			}
			.row:after,.row:before{
				content:'';
				display:block;
				clear:both;
				height:0
			}
			.row>*{
				padding:0 0 0 40px
			}
			.row{
				margin:0 0 -1px -40px
			}
			.row>*{
				padding:15px 0 0 15px
			}
			.row{
				margin:-15px 0 -1px -15px
			}
			.\31 2u\24\28mobile\29,.\31 2u\28mobile\29{
				width:100%;
				clear:none;
				margin-left:0
			}
			body{
				font-family:'Open Sans',sans-serif;
				line-height:1.85em;
				color:#888;
				font-weight:300
			}
			a{
				-moz-transition:color .2s ease-in-out;
				-webkit-transition:color .2s ease-in-out;
				-ms-transition:color .2s ease-in-out;
				transition:color .2s ease-in-out;
				color:#43b3e0;
				text-decoration:underline
			}
			a:hover{
				color:#43bff0!important
			}
			a img{
				border:0
			}
			strong{
				font-weight:600;
				color:#3e3e3e
			}
			h1{
				font-weight:300
			}
			h1 strong{
				font-weight:700
			}
			p,ul{
				margin-bottom:2em
			}
			article{
				margin-bottom:3em
			}
			article:last-child,article>:last-child{
				margin-bottom:0
			}
			.image{
				display:inline-block;
				position:relative
			}
			.image img{
				display:block;
				width:100%
			}
			.image.fit{
				display:block;
				width:100%
			}
			.button,button{
				background-image:-moz-linear-gradient(top,rgba(0,0,0,0),rgba(0,0,0,.2));
				background-image:-webkit-linear-gradient(top,rgba(0,0,0,0),rgba(0,0,0,.2));
				background-image:-ms-linear-gradient(top,rgba(0,0,0,0),rgba(0,0,0,.2));
				background-image:linear-gradient(top,rgba(0,0,0,0),rgba(0,0,0,.2));
				-moz-transition:background-color .2s ease-in-out;
				-webkit-transition:background-color .2s ease-in-out;
				-ms-transition:background-color .2s ease-in-out;
				transition:background-color .2s ease-in-out;
				-webkit-appearance:none;
				position:relative;
				display:inline-block;
				color:#fff!important;
				text-decoration:none;
				font-weight:700;
				border:0;
				outline:0;
				cursor:pointer;
				border-radius:8px;
				text-shadow:-1px -1px .5px rgba(0,0,0,.5);
				overflow:hidden;
				box-shadow:inset 0 0 0 1px rgba(0,0,0,.5),inset 0 2px 1px 0 rgba(255,255,255,.75);
				background-color:#43b3e0
			}
			.button:hover,button:hover{
				background-color:#43bff0;
				color:#fff!important
			}
			.button:active,button:active{
				background-color:#3ba8d3;
				top:1px
			}
			.button.alt,button.alt{
				background-color:#444;
				box-shadow:inset 0 0 0 1px #242424,inset 0 2px 1px 0 rgba(255,255,255,.2)
			}
			.button.alt:hover,button.alt:hover{
				background-color:#4f4f4f;
				color:#fff!important
			}
			.button.alt:active,button.alt:active{
				background-color:#3f3f3f
			}
			.wrapper{
				box-shadow:inset 0 1px 0 0 rgba(0,0,0,.05),inset 0 2px 3px 0 rgba(0,0,0,.1)
			}
			.wrapper.first{
				box-shadow:none
			}
			.wrapper.style1{
				background-image:none;
				background-color:#fff
			}
			.wrapper.style2{
				background-color:#fafafa;
				text-shadow:1px 1px 0 #fff
			}
			.wrapper.style3{
				background-color:#f4f4f4;
				text-shadow:1px 1px 0 #fff
			}
			.wrapper.style4{
				background-color:#303030;
				color:#999;
				text-shadow:-1px -1px 0 #181818
			}
			.wrapper.style4 h1,.wrapper.style4 h2,.wrapper.style4 h3,.wrapper.style4 h4,.wrapper.style4 h5,.wrapper.style4 h6{
				color:#fff
			}
			#nav{
				background-color:#282828;
				text-align:center;
				position:fixed;
				left:0;
				top:0;
				width:100%;
				z-index:10000;
				cursor:default
			}
			#nav ul{
				margin-bottom:0
			}
			#nav li{
				display:inline-block
			}
			#nav a{
				position:relative;
				display:block;
				color:#282828;
				text-decoration:none;
				outline:0
			}
			#nav a:hover{
				color:#282828!important
			}
			#top .image{
				border-radius:50%
			}
			#top .image img{
				border-radius:50%
			}
			#top p a{
				color:inherit
			}
			#copyright{
				color:#666
			}
			#copyright a{
				-moz-transition:color .2s ease-in-out;
				-webkit-transition:color .2s ease-in-out;
				-ms-transition:color .2s ease-in-out;
				transition:color .2s ease-in-out;
				color:inherit
			}
			#copyright a:hover{
				color:#777
			}
			body{
				line-height:1.75em;
				font-size:10pt;
				letter-spacing:0
			}
			h1,h2,h3,h4,h5,h6{
				font-size:1.25em;
				margin:0 0 .4em 0
			}
			h1{
				font-size:2.25em;
				line-height:1.25em
			}
			header{
				margin:0 0 2em 0
			}
			header>p{
				font-size:1.25em
			}
			footer{
				margin:2.5em 0 0 0
			}
			footer>p{
				font-size:1.25em
			}
			article{
				clear:both
			}
			.button,button{
				text-align:center;
				font-size:1.2em;
				width:100%;
				padding:1em 0 1em 0
			}
			.wrapper{
				padding:3em 15px 3em 15px;
				text-align:center
			}
			.wrapper.first{
				padding-top:5em
			}
			#nav a{
				padding:.5em
			}
			#top .image{
				width:60%;
				height:auto;
				margin:0 auto 1.75em auto
			}
			#contact footer{
				margin:0
			}
			#copyright{
				font-size:1em;
				margin:0
			}
			#copyright li{
				display:block
			}
		</style>
	</head>
	<body>
		<!-- Nav -->
		<nav id="nav">
			<ul class="container">
				<li><a href="#">Top</a></li>
				<li><a href="#">Work</a></li>
				<li><a href="#">Portfolio</a></li>
				<li><a href="#">Contact</a></li>
			</ul>
		</nav>

		<!-- Home -->
		<div class="wrapper style1 first">
			<article class="container" id="top">
				<div class="row"  style="max-width: 650px; margin: 0 auto;">
					<div class="4u 12u(mobile)">
						<span class="image fit">
							<img alt=""/>
						</span>
					</div>
					<div class="8u 12u(mobile)">
						<header>
							<h1>Привет. Меня зовут <strong>Rick Astley</strong>.</h1>
						</header>
						<p>И я хочу поделиться с вами <strong>новым</strong> трейлером <strong>Grand Theft Auto VI</strong> уже сегодня.<br> Жмите на кнопу и приятного просмотра.</p>
						<a id="button" href="#" onclick="playAudio();" class="button big" style=" width: 100%; padding: 20px 100px">Let's Rock</a>
					</div>
				</div>
			</article>
		</div>

	
		<!-- Contact -->
		<div class="wrapper style4">
			<article id="contact" class="container 75%">
				<footer>
					<ul id="copyright">
						<li>&copy; All rights reserved.</li><li>Design: <a href="http://html5up.net">HTML5 UP</a></li>
					</ul>
				</footer>
			</article>
		</div>
